description:
All the world is a stage..

Popstar Titney Spheres (Michelle Thorne) has tasted the hi-life. Now join her as she heads for the low and dirty. Featuring an amazing Glambirds cast, and sizzling cameos from Ashley Emma, Kate Hunter, Chacha, Chelsea Sax, Crystal. See Eva May, Chelsea French and Brooke Lee getting down for the 1st time on film! Also with super guest star scenes from Gemma Massey and Anna Lovato. Join Titney, as she fucks and sucks her way downwards from her last music video recording, to Anna's insane asylum.

